function performSearch() {
  const rawQuery = document.getElementById('searchInput').value;
  const terms = rawQuery.trim().toLowerCase().split(/\s+/).filter(Boolean);

  if (terms.length === 0) {
    alert("Please enter a keyword to search.");
    return;
  }

  let foundLinks = new Set();
  for (const key in keywordMap) {
    for (const term of terms) {
      if (key.includes(term)) {
        keywordMap[key].forEach(url => foundLinks.add(url));
      }
    }
  }

  if (foundLinks.size > 0) {
    foundLinks.forEach(url => window.open(url, "_blank"));
  } else {
    alert("No results found for: " + rawQuery);
  }
}
</script>
